export default function Task({ tasks }) {
  return (
    <>
      {tasks.length === 0 ? (
        <p style={{ color: 'gray', textAlign: 'center' }}>No tasks yet</p>
      ) : (
        tasks.map((item) => (
          <div
            key={item.id}
            style={{
              margin: '5px 0',
              padding: '8px',
              background: '#f4f4f4',
              borderRadius: '6px',
            }}
          >
            {item.name}
          </div>
        ))
      )}
    </>
  );
}
